lled and active on this site.</b> Please be aware that the WooCommerce Legacy REST API is <b>not</b> compatible with HPOS.'=>'⚠ <b><a target="_blank" href="%s">De verouderde REST API-plugin</a> is geïnstalleerd en actief op deze site.</b> Let op dat de verouderde WooCommerce REST API <b>niet</b> compatibel is met HPOS.','Track inventory'=>'Voorraad bijhouden','Data in posts table appears to be more recent than in HPOS tables. Compare order data with `wp wc hpos diff %1$d` and use `wp wc hpos backfill %1$d --from=posts --to=hpos` to fix.'=>'Gegevens in berichtentabel lijkt recenter te zijn dan de gegevens in HPOS-tabellen. Vergelijk bestelgegevens met `wp wc hpos diff %1$d` en gebruik `wp wc hpos backfill %1$d --from=posts --to=hpos` voor oplossingen.','⚠️ The file system connection could not be initialized.'=>'⚠️ De verbinding met het bestandssysteem kan niet worden aangegaan.','You may want to switch to the database for log storage.'=>'Je wil misschien overschakelen naar de database voor log opslag.','⚠️ The file system is not configured for direct writes. This could cause problems for the logger.'=>'⚠️ Het bestandssysteem is niet ingesteld voor direct schrijven. Dit kan problemen veroorzaken voor de logger.','✅ Ready'=>'✅ gereed','Cleanup completed for %d order. Review errors above.'=>'Opschoning voltooid voor %d bestelling. Controleer de bovenstaande foutmeldingen.' . "\0" . 'Opschoning voltooid voor %d bestellingen. Controleer de bovenstaande foutmeldingen.','Failed to clean up all orders in a batch. Aborting.'=>'Fout bij het opschonen van alle bestellingen in een batch. Annuleren.','Page template for Coming soon page.'=>'Pagina template voor komt binnenkort pagina.','Template namePage: Coming soon'=>'Pagina: Binnenkort beschikbaar','Hide shipping costs until an address is entered (Not available when using the <a href="%s">Local pickup options powered by the Checkout block</a>)'=>'Verberg de verzendkosten tot het adres is ingevoerd (niet beschikbaar wanneer je 