ict.'=>'Code van staat/graafschap, of naam van de staat, graafschap, provincie of het district.','Apartment, suite, etc.'=>'Appartement, suite enz.','Price prefix for the currency which can be used to format returned prices.'=>'Voorvoegsel van de prijs voor de valuta die kan worden gebruikt voor de indeling van aangegeven prijzen.','Thousand separator for the currency which can be used to format returned prices.'=>'Scheidingsteken van duizendtallen voor de valuta die kan worden gebruikt voor de indeling van aangegeven prijzen.','Decimal separator for the currency which can be used to format returned prices.'=>'Decimaal scheidingsteken voor de valuta die kan worden gebruikt voor de indeling van aangegeven prijzen.','Currency minor unit (number of digits after the decimal separator) for returned prices.'=>'Decimaaleenheid van valuta (aantal cijfers na het scheidingsteken) voor aangegeven prijzen.','Currency symbol for the currency which can be used to format returned prices.'=>'Valutateken voor de valuta die kan worden gebruikt voor het format van aangegeven prijzen.','Currency code (in ISO format) for returned prices.'=>'Valutacode (in ISO-indeling) van de aangegeven prijzen.','Total tax removed due to discount applied by this coupon.'=>'Totale verwijderde belasting vanwege korting die via deze waardebon is toegepast.','Total discount applied by this coupon.'=>'Totale korting toegepast via deze waardebon.','Total amounts provided using the smallest unit of the currency.'=>'Totaalbedrag, aangegeven met de kleinste valuta-eenheid.','The coupons unique code.'=>'De unieke code van de waardebon.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'Een URL om de klant door te leiden na het afrekenen. Dit kan bijvoorbeeld een link naar de site van de betalingsverwerker zijn.','An array of data being returned from the payment gateway.'=>'Een reeks gegevens die worden teruggezonden door de betalingsgateway.','Status of the payment returned by the gateway. One of success, pending, failure, error.'=>'Status van de betaling die wordt teruggezonden door de gateway. Succes, in behandeling, mislukt of fout.','Result of payment processing, or false if not yet processed.'=>'Resultaat van verwerking van betaling, of onwaar indien nog niet verwerkt.','The ID of the payment method being used to process the payment.'=>'De ID van de betaalmethode die wordt gebruikt om de betaling te verwerken.','Customer ID if registered. Will return 0 for guests.'=>'Klant-ID indien geregistreerd. Geeft 0 aan voor gasten.','Note added to the order by the customer during checkout.'=>'Opmerking toegevoegd aan de bestelling door de klant tijdens het afrekenen.','Order key used to check validity or protect access to certain order data.'=>'Bestelsleutel gebruikt om de geldigheid te controleren of toegang tot bepaalde bestelgegevens te beschermen.','Order status. Payment providers will update this value after payment.'=>'Bestelstatus. Betalingsproviders updaten deze waarde na betaling.','The order ID to process during checkout.'=>'De bestel-ID om te verwerken tijdens het afrekenen.','Parent term ID, if applicable.'=>'Bovenliggende trefwoord-ID, indien van toepassing.','Quantity left in stock if stock is low, or null if not applicable.'=>'Hoeveelheid op voorraad als de voorraad laag is, of niets, indien dit niet van toepassing is.','List of variation IDs, if applicable.'=>'Lijst met variatie-ID\'s, indien van toepassing.','Price string formatted as HTML.'=>'Prijsreeks in HTML-indeling.','Price data provided using the smallest unit of the currency.'=>'Prijsgegevens, aangegeven met de kleinste valuta-eenheid.','Product full description in HTML format.'=>'Volledige beschrijving van product in HTML-indeling.','Product short description in HTML format.'=>'Korte beschrijving van product in HTML format.','ID of the parent product, if applicable.'=>'ID van bovenliggend product, indien van toepassing.','&quot;%s&quot; is not available for purchase.'=>'&quot;%s&quot; kan niet worden aangeschaft.','The "%1$s" coupon has been removed from your cart: %2$s'=>'De waardebon \'%1$s\' is verwijderd uit je winkelwagen: %2$s','"%s" has already been applied and cannot be used in conjunction with other coupons.'=>'\'%s\' is al toegepast en kan niet in combinatie met andere waardebonnen worden gebruikt.','Coupon code "%s" has already been applied.'=>'Waardeboncode \'%s\' is al toegepast.','"%s" is an invalid coupon code.'=>'\'%s\' is een geldige waardeboncode.','Cart item is invalid.'=>'Winkelwagenartikel is ongeldig.','Invalid coupons were removed from the cart: "%s"'=>'Ongeldige waardebonnen zijn verwijderd uit de winkelwagen: \'%s\'','Cannot create order from empty cart.'=>'Kan geen bestelling creëren uit een lege winkelwagen.','The chosen rate ID for the package.'=>'De gekozen kosten-ID voor het pakket.','Limit result set to reviews from specific product IDs.'=>'Beperk resultaten tot beoordelingen van specifieke product-ID\'s.','Limit result set to reviews from specific category IDs.'=>'Beperk resultaten tot beoordelingen van specifieke categorie-ID\'s.','Method not implemented'=>'Methode niet geïmplementeerd','New quantity of the item in the cart.'=>'Nieuwe hoeveelheid van dit artikel in de winkelwagen.','Unique identifier (key) for the cart item to update.'=>'Unieke identificatiecode (sleutel) voor het winkelwagenartikel dat moet worden geüpdatet.','The %s payment gateway is not available.'=>'Deze %s betaal gateway is niet beschikbaar.','No payment method provided.'=>'Geen betaalmethode opgegeven.','Invalid payment result received from payment method.'=>'Ongeldig betaalresultaat ontvangen via betaalmethode.','Data to pass through to the payment method when processing payment.'=>'Gegevens die naar de betaalmethode worden geleid bij het verwerken van betalingen.','Cart item no longer exists or is invalid.'=>'Winkelwagenartikel bestaat niet meer of is ongeldig.','Unique identifier (key) for the cart item.'=>'Unieke identificatiecode (sleutel) voor het winkelwagenartikel.','If true, empty terms will not be returned.'=>'Indien waar worden lege trefwoorden niet aangegeven.','Sort by term property.'=>'Sorteren op trefwoordeigenschap.','Sort ascending or descending.'=>'Oplopend of aflopend sorteren.','Coupon does not exist in the cart.'=>'Waardebon niet aanwezig in de winkelwagen.','Coupon cannot be removed because it is not already applied to the cart.'=>'Waardebon kan niet verwijderd worden, omdat deze nog niet is toegepast op de winkelwagen.','Invalid coupon code.'=>'Ongeldige waardeboncode.','Coupons are disabled.'=>'Waardebonnen zijn uitgeschakeld.','Unique identifier for the coupon within the cart.'=>'Unieke identificatiecode voor de waardebon in de winkelwagen.','ISO code for the country of the address being shipped to.'=>'ISO-code voor het land van het adres waarnaar verzonden wordt.','Zip or Postcode of the address being shipped to.'=>'Postcode van het adres waarnaar verzonden wordt.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'ISO-code, of naam, voor de staat, provincie of het district van het adres waarnaar verzonden wordt.','City of the address being shipped to.'=>'Stad van het adres waarnaar verzonden wordt.','Second line of the address being shipped to.'=>'Tweede regel van het adres waarnaar verzonden wordt.','First line of the address being shipped to.'=>'Eerste regel van het adres waarnaar verzonden wordt.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Resultaatset beperken tot producten op basis van een maximumprijs, aangegeven met de kleinste valuta-eenheid.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Resultaatset beperken tot producten op basis van een minimumprijs, aangegeven met de kleinste valuta-eenheid.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Maximumaantal artikelen dat moet worden aangegeven in resultaatset. Heeft standaard geen limiet indien leeg gelaten.','Invalid category ID.'=>'Ongeldige categorie-ID.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'WooCommerce %1$s-tabelopstelling mislukt. Heeft de %2$s-gebruiker machtigingen voor AANMAKEN op de %3$s-database?','Verifying database... One or more tables are still missing: '=>'Database wordt geverifieerd ... Eén of meer tabellen ontbreken nog altijd: ','Database verified successfully.'=>'Database geverifieerd.','You need WooCommerce 4.2 or newer to run this tool.'=>'Je hebt WooCommerce 4.2 of nieuwer nodig om deze tool te kunnen gebruiken.','The active version of WooCommerce does not support template cache clearing.'=>'De actieve versie van WooCommerce ondersteunt het wissen van de template cache niet.','Template cache cleared.'=>'Template cache gewist.','Verify if all base database tables are present.'=>'Verifieer of alle basis-databasetabellen aanwezig zijn.','Verify database'=>'Verifieer database','Verify base database tables'=>'Verifieer basis-databasetabellen','This tool will empty the template cache.'=>'Met dit gereedschap wordt de template cache geleegd.','Clear template cache'=>'Template cache wissen','Collect and validate EU VAT numbers at checkout'=>'Verzamel en valideer EU btw-nummers bij het afrekenen','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Als je winkel zich in de EU bevindt, raden we je aan de extensie EU btw-nummer te gebruiken als aanvulling op geautomatiseerde belastingen. Tijdens het afrekenen wordt er dan een veld weergegeven waarmee je het EU btw-nummer van een klant kunt verzamelen en valideren als ze er een hebben.','Get real-time order alerts anywhere'=>'Bestellingsmeldingen overal in real-time ontvangen','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Ontvang meldingen over de winkelactiviteit, zoals nieuwe bestellingen en productbeoordelingen op je mobiele apparaten met de Woo-app.','First order received'=>'Eerste bestelling ontvangen','Remove legacy coupon menu'=>'Verouderd waardebonmenu verwijderen','Coupons can now be managed from Marketing > Coupons. Click the button below to remove the legacy WooCommerce > Coupons menu item.'=>'Waardebonnen kunnen nu worden beheerd vanuit Marketing > Waardebonnen. Klik op de knop hieronder om het verouderde menu-item WooCommerce > Waardebonnen te verwijderen.','Coupon management has moved!'=>'Waardebonbeheer is verplaatst!','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Deze videotutorial helpt je bij het toevoegen van je eerste product aan WooCommerce.','Do you need help with adding your first product?'=>'Hulp nodig bij het toevoegen van je eerste product?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Een mode-site starten is spannend, maar het kan ook wat overweldigend lijken. In dit artikel helpen we je bij het configuratieproces, leren we je hoe je succesvolle productvermeldingen kunt maken en laten we zien hoe je je producten aan je ideale doelgroep kunt aanbieden.','Start your online clothing store'=>'Begin je online kledingwinkel','The admin note layout has a wrong prop value.'=>'De lay-out van de beheerder notitie heeft een verkeerde prop-waarde.','Watch tutorial'=>'Bekijk tutorial','Share feedback'=>'Deel je feedback','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Nu je ons hebt gekozen als partner is het ons doel om te zorgen dat wij je van de juiste gereedschappen kunnen voorzien om aan je behoeften te voldoen. We kijken ernaar uit om je feedback over de winkelconfiguratie te lezen, zodat we deze in de toekomst kunnen verbeteren.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Het overschakelen tussen eCommerce-platformen lijkt misschien een lastige stap, maar het is eenvoudiger dan je zou denken om je producten, klanten en bestellingen naar WooCommerce te verplaatsen. Dit artikel helpt je bij dit proces.','Do you want to migrate from Shopify to WooCommerce?'=>'Wil je van Shopify naar WooCommerce migreren?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'Met WooCommerce-abonnementen kun je verschillende abonnementen voor fysieke of virtuele producten en diensten toevoegen. Creëer product-van-de-maand-clubs, wekelijkse serviceabonnementen of zelfs jaarlijkse software-facturatiepakketten. Voeg aanmeldingskosten toe, bied gratis proefperioden aan of stel vervalperioden in.','Do you need more info about WooCommerce Subscriptions?'=>'Heb je meer informatie nodig over WooCommerce-abonnementen?','There was a problem activating some of the requested plugins.'=>'Er is een probleem opgetreden bij het activeren van sommige van de gevraagde plugins.','Plugins were successfully activated.'=>'Plugins geactiveerd.','The requested plugin `%s`. is not yet installed.'=>'De gevraag