ectory indexing</a>.'=>'De uploadmap van je winkel is <a href="%1$s">online bereikbaar</a>. We raden je sterk aan <a href="%2$s">je webserver te configureren om map-indexering te voorkomen</a>.','%s() was called before the Action Scheduler data store was initialized'=>'%s() is opgeroepen voordat de Actieplanner-gegevensopslag is gestart','Finish setup'=>'Configuratie voltooien','Take payments via bank transfer.'=>'Betalingen innen via bankoverschrijving.','Take payments in cash upon delivery.'=>'Betalingen in contanten innen bij levering.','Payfast'=>'PayFast','If checked, free shipping would be available based on pre-discount order amount.'=>'Gratis verzending is, indien aangevinkt, mogelijk op basis van het bestelbedrag zonder de korting.','Apply minimum order rule before coupon discount'=>'Pas de minimum bestellingsregel toe vóór waardebon korting','Coupons discounts'=>'Waardebon kortingen','Please visit the <a href="%s" target="_blank">subscriptions page</a> and renew to continue receiving updates.'=>'Ga naar de <a href="%s" target="_blank">abonnementenpagina</a> en verleng om updates te blijven ontvangen.','WooCommerce.com support'=>'Ondersteuning voor WooCommerce.com','For further assistance with WooCommerce core, use the <a href="%1$s">community forum</a>. For help with premium extensions sold on WooCommerce.com, <a href="%2$s">open a support request at WooCommerce.com</a>.'=>'Voor verdere hulp met WooCommerce core, gebruik het <a href="%1$s">community forum</a>. Voor hulp met premium extensies verkocht op WooCommerce.com, <a href="%2$s">open een ondersteuningsverzoek op WooCommerce.com</a>.','Installed version not tested with active version of WooCommerce %s'=>'Geïnstalleerde versie niet getest met actieve versie van WooCommerce %s','%1$s (update to version %2$s is available)'=>'%1$s (update naar versie %2$s is beschikbaar)','Visit WooCommerce.com to learn more about <a href="%1$s" target="_blank">getting started</a>.'=>'Bezoek WooCommerce.com om meer te ler