p het postkantoor door je verzendlabels thuis af te drukken. Probeer ShipStation 30 dagen gratis.','WooCommerce Services icon'=>'Icoon WooCommerce diensten','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'De huidige tarieven zijn de exacte kosten om een bestelling te verzenden, waarbij de offerte rechtstreeks afkomstig is van de bezorger.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Als je de <span class="help_tip" data-tip="%1$s">huidige tarieven</span> van een specifieke bezorger (bijv. UPS) wilt aanbieden, kun je <a href="%2$s" target="_blank">hier</a> verschillende extensies vinden voor WooCommerce.','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'We hebben twee verzendzones aangemaakt: voor %s en voor de rest van de wereld. Hieronder kun je een vast verzendtarief instellen voor deze zones of gratis verzending aanbieden.','Yards'=>'Yards','Inches'=>'Inches','Millimeters'=>'Millimeter','Centimeters'=>'Centimeter','Meters'=>'Meter','Ounces'=>'Ounces','Pounds'=>'Pounds','Grams'=>'Gram','Kilograms'=>'Kilogram','Item moved down'=>'Artikel omlaag verplaatst','Item moved up'=>'Artikel omhoog verplaatst','You may need to manually restore the item\'s stock.'=>'Je zult de voorraad van het artikel mogelijk handmatig moeten herstellen.','Are you sure you want to remove the selected items?'=>'Weet je zeker dat je de geselecteerde artikelen wil verwijderen?','Alto Paraguay'=>'Alto Paraguay','Presidente Hayes'=>'Presidente Hayes','Amambay'=>'Amambay','Central'=>'Central','Cordillera'=>'Cordillera','San Pedro'=>'San Pedro','Sud Sardegna'=>'Sud Sardegna','Apartment, suite, unit, etc.'=>'Appartement, suite, unit enz.','%d API key permanently revoked.'=>'%d API-sleutel permanent ingetrokken.' . "\0" . '%d API-sleutels permanent ingetrokken.','Cannot set attributes due to invalid parent product.'=>'Kan eigenschappen niet instellen vanwege een ongeldig bovenliggend product.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Deze actie kan niet ongedaan worden gemaakt. Weet je zeker dat je persoonsgegevens uit de geselecteerde bestellingen wilt wissen?','shipping packagesShipping %d'=>'Verzending %d','Payer PayPal address'=>'PayPal-adres betaler','Payer last name'=>'Achternaam betaler','Payer first name'=>'Voornaam betaler','Shipping Address'=>'Verzendadres','Billing Address'=>'Factuuradres','Shipping Address 1'=>'Verzendadres 1','Billing Address 1'=>'Factuuradres 1','MySQL version string.'=>'MySQL versie string.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Je CSV moet kolommen in een specifieke volgorde bevatten. %1$sKlik hier om een voorbeeld te downloaden%2$s.','This will be how your name will be displayed in the account section and in reviews'=>'Je naam wordt op deze manier weergegeven in de accountsectie en in beoordelingen','If you have a coupon code, please apply it below.'=>'Als je een waardeboncode hebt, kun je deze hieronder gebruiken.','terms and conditions'=>'algemene voorwaarden','privacy policy'=>'privacybeleid','United States (US) dollar'=>'Amerikaanse dollar (USD)','eCheck ending in %1$s'=>'eCheck die eindigt op %1$s','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal biedt ons de mogelijkheid om naar één adres te verzenden. Als je PayPal gebruikt voor verzendlabels, kun je overwegen om het verzendadres te gebruiken in plaats van het factuuradres. Als je deze optie uitschakelt, is de Verkopersbescherming van PayPal mogelijk niet meer van toepassing.','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard leidt klanten om naar PayPal, zodat ze hun betaalgegevens kunnen invullen.','Other locations'=>'Andere locaties','%1$s &ndash; %2$s'=>'%1$s – %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Elke \'%1$s\'-methode','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Betalingen persoonlijk aannemen via cheques. Deze offline gateway kan ook nuttig zijn om aankopen te testen.','Account details:'=>'Accountgegevens:','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Betalingen persoonlijk aannemen via BACS. Dit staat beter bekend als een directe bankoverschrijving.','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'over,een,zijn,als,op,tegen,com,voor,van,hoe,in,is,het,bij,aan,of,dat,de,het,deze,dit,om,was,wat,wanneer,waar,wie,zal,met,www','Optionally add some text for the terms checkbox that customers must accept.'=>'Je kan eventueel extra tekst toevoegen voor het voorwaarden-selectievakje dat klanten moeten accepteren.','%s page'=>'%s pagina','No page set'=>'Geen pagina ingesteld','Highlight required fields with an asterisk'=>'Geef verplichte velden aan met een asterisk','I have read and agree to the website %s'=>'Ik heb de %s van de site gelezen en ga hiermee akkoord','Required'=>'Vereist','%s field'=>'Het veld %s','These options let you change the appearance of the WooCommerce checkout.'=>'Met deze optie kun je de weergave van de afrekenpagina voor WooCommerce wijzigen.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Raadpleeg het <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">privacybeleid van PayPal</a> voor meer informatie.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'We accepteren betalingen via PayPal. Bij het verwerken van betalingen worden sommige gegevens overgedragen aan PayPal. Hiertoe behoort informatie die noodzakelijk is om de betaling te verwerken of ondersteunen, zoals het totaalbedrag van de aankoop en factuurgegevens.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'In deze subsectie moet je vermelden welke betalingsverwerker van derden je gaat gebruiken voor betalingen op je site, aangezien hier klantgegevens aan gebonden kunnen zijn. We hebben PayPal als voorbeeld toegevoegd, maar je zult deze moeten verwijderen als je geen gebruikmaakt van PayPal.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'We delen informatie met derden die ons helpen onze bestellingen te leveren en diensten aan je op te slaan; bijvoorbeeld --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'In deze sectie moet je vermelden met wie je gegevens deelt en met welk doel. Hiertoe kan onder andere het volgende behoren: analyse, marketing, gateways voor betaling, bezorgdiensten en insluitingen van derden.','What we share with others'=>'Wat we delen met anderen','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Onze teamleden hebben toegang tot deze informatie om bestellingen te voltooien, te behandelen, terugbetalingen te doen en om je te ondersteunen.','Customer information like your name, email address, and billing and shipping information.'=>'Klantinformatie, zoals je naam, e-mailadres, verzend- en betaalinformatie.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Bestellingsinformatie, zoals de aangeschafte producten, de datum van aanschaf en het bezorgadres, en','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Leden van ons team hebben toegang tot de informatie die je bij ons hebt opgegeven. Zowel Beheerders als Winkelmanagers hebben bijvoorbeeld toegang tot:','Who on our team has access'=>'Wie van ons team heeft toegang','We will also store comments or reviews, if you choose to leave them.'=>'Wij zullen ook reacties of beoordelingen opslaan, indien je deze achterlaat.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Over het algemeen slaan we informatie over je op zolang we deze nodig hebben voor het doel waarvoor we deze verzamelen en gebruiken. We zijn niet wettelijk vereist deze te bewaren. We bewaren bestelinformatie bijvoorbeeld XXX jaar voor belasting- en boekhoudingsdoeleinden. Tot deze informatie behoort je naam, e-mailadres, en factuur- en verzendadres.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Als je een account aanmaakt, worden je naam, adres, e-mailadres en telefoonnummer gebruikt om de afrekengegevens automatisch in te vullen bij toekomstige bestellingen.','Send you marketing messages, if you choose to receive them'=>'Om marketingberichten naar je te sturen, als je hiervoor kiest','Improve our store offerings'=>'Om ons winkelaanbod te verbeteren','Comply with any legal obligations we have, such as calculating taxes'=>'Voldoe aan alle wettelijke verplichtingen die we hebben, zoals het berekenen van belastingen','Set up your account for our store'=>'Om je account voor onze winkel in te stellen','Process payments and prevent fraud'=>'Om betalingen te verwerken en fraude te voorkomen','Respond to your requests, including refunds and complaints'=>'Om te reageren op je aanvragen, waaronder restituties en klachten','Send you information about your account and order'=>'Om je informatie toe te sturen over je account en bestelling','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Wanneer je producten bij ons aanschaft, vragen we je om informatie te verstrekken, waaronder je naam, factuuradres, verzendadres, e-mailadres, telefoonnummer, creditcard-/betalingsgegevens en optionele accountgegevens, zoals een gebruikersnaam en wachtwoord. We gebruiken deze informatie voor de volgende doeleinden:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Opmerking: je kunt je cookiebeleid gedetailleerd beschrijven en hier een link naar dat sectie toevoegen.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'We gebruiken cookies ook om producten in je winkelwagen op te slaan terwijl je door onze site bladert.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Verzendadres: we vragen je om deze gegevens in te vullen, zodat we bijvoorbeeld de verzendkosten kunnen berekenen voordat je een bestelling plaatst en om de bestelling vervolgens naar je te verzenden!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Locatie, IP-adres en browsertype: we gebruiken deze gegevens om belastingtoeslagen en verzendkosten te berekenen','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Door jou bekeken producten: we gebruiken deze gegevens bijvoorbeeld om producten aan je te tonen die je recentelijk hebt bekeken','While you visit our site, we’ll track:'=>'Wanneer je onze site bezoekt, verzamelen we de volgende gegevens:','What we collect and store'=>'Wat we verzamelen en opslaan','We collect information about you during the checkout process on our store.'=>'We verzamelen informatie over je tijdens het afrekenproces in onze winkel.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Deze voorbeeldtekst bevat de basisbeginselen over welke persoonsgegevens je winkel mogelijk verzamelt, opslaat en deelt, evenals wie mogelijk toegang heeft tot deze gegevens. Afhankelijk van welke instellingen zijn ingeschakeld en welke aanvullende plugins worden gebruikt, kan de specifieke informatie, die door je winkel wordt gedeeld, verschillen. We raden je aan om een jurist om advies te vragen wanneer je besluit welke informatie je wil opnemen in je privacybeleid.','Token'=>'Token','Payment Tokens'=>'Betalingstokens','Access granted'=>'Toegang goedgekeurd','Download count'=>'Aantal keer gedownload','User email'=>'E-mailadres gebruiker','Browser User Agent'=>'User Agent van browser','Items Purchased'=>'Aanges