 proceed with your order.'=>'Lees en ga akkoord met de algemene voorwaarden om door te gaan met je bestelling.','Unserializing instances of this class is forbidden.'=>'Exemplaren van deze klasse zonder serienummer weergeven is verboden.','Cloning is forbidden.'=>'Klonen is verboden.','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s is uit je winkelwagen verwijderd, omdat het artikel sindsdien is aangepast. Je kunt het <a href="%2$s">hier</a> opnieuw toevoegen aan je winkelwagen.','Deleted all active sessions, and %d saved carts.'=>'Alle actieve sessies en %d opgeslagen winkelwagens verwijderd.','%d permissions deleted'=>'%d permissies verwijderd','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Met dit gereedschap worden alle gegevens van klantsessies uit de database verwijderd, inclusief huidige winkelwagens en opgeslagen winkelwagens in de database.','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Deze tool verwijdert downloadtoestemmingen en toestemmingen met 0 resterende downloads.','Clean up download permissions'=>'Downloadtoestemmingen opschonen','Used-up download permissions'=>'Opgebruikte downloadtoestemmingen','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Beperk resultaten tot producten met een specifieke eigenschap. Gebruik de slug taxonomie-naam/-eigenschap.','If the payment was refunded via the API.'=>'Indien de betaling is gerestitueerd via de API.','Order total formatted for locale'=>'Totaaloverzicht van bestelling aangepast aan taal','Name of the customer for the order'=>'Naam van de klant voor de bestelling','URL to edit the order'=>'URL om de bestelling te bewerken','Blog id of the record on the multisite.'=>'Blog-ID van de record op de multisite.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Het lijkt erop dat je winkel geen veilige verbinding gebruikt. We raden je ten zeerste aan je hele site via een HTTPS-verbinding aan te bieden, zodat de gegevens van je klanten veilig zijn. <a href="%s">Bekijk hier meer informatie.</a>','WooCommerce pages'=>'WooCommerce-pagina\'s','WooCommerce database version'=>'Versie WooCommerce-database','Displays whether or not WordPress is using an external object cache.'=>'Geeft weer of WordPress gebruikmaakt van een externe object-cache.','External object cache'=>'Externe object-cache','WordPress cron'=>'WordPress cron','WordPress debug mode'=>'WordPress debug-modus','WordPress memory limit'=>'WordPress geheugenlimiet','WordPress multisite'=>'WordPress multisite','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Er is een nieuwere versie van WordPress beschikbaar (%2$s)','WordPress version'=>'WordPress versie','WooCommerce version'=>'WooCommerce versie','Settings tab labelPayments'=>'Betalingen','Enable coupons'=>'Waardebonnen inschakelen','Rates will be configurable and taxes will be calculated during checkout.'=>'De tarieven kunnen worden aangepast en belastingen worden tijdens het afrekenen berekend.','Enable tax rates and calculations'=>'Belastingtarieven en -berekeningen inschakelen','Manage'=>'Beheren','Account endpoints'=>'Account-eindpunten','Secure checkout'=>'Veilig afrekenen','Legacy API'=>'Legacy API','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Afgeronde bestellingen gedurende een gespecificeerde tijd bewaren, voordat de bijbehorende persoonsgegevens geanonimiseerd worden.','Retain completed orders'=>'Afgeronde bestellingen bewaren','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Geannuleerde bestellingen zijn niet betaald en mogelijk geannuleerd door de winkeleigenaar of klant. Deze worden naar de prullenbak verplaatst na de gespecificeerde tijd.','Retain cancelled orders'=>'Geannuleerde bestellingen bewaren','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Mislukte bestellingen zijn niet betaald en mogelijk ingetrokken door de klant. Deze worden verwijderd na de gespecificeerde tijd.','Retain failed orders'=>'Mislukte bestellingen bewaren','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Bestellingen in behandeling zijn niet betaald en mogelijk ingetrokken door de klant. Deze worden verwijderd na de gespecificeerde tijd.','Retain pending orders '=>'Bestellingen in behandeling bewaren ','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Inactieve accounts zijn degene waarop niet is ingelogd of geen bestelling is geplaatst gedurende de gespecificeerde tijd. Deze worden verwijderd. Openstaande bestellingen worden omgezet in gastbestellingen.','Retain inactive accounts '=>'Inactieve accounts bewaren ','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Bepaal hoe lang persoonsgegevens bewaard moeten worden wanneer deze niet meer verwerkt hoeven te worden. Laat de volgende opties open om deze gegevens voor onbepaalde tijd te bewaren.','Personal data retention'=>'Persoonsgegevens bewaren','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Je persoonlijke gegevens zullen worden gebruikt om je bestelling te verwerken, om je beleving op deze site te optimaliseren en voor andere doeleinden zoals beschreven in onze %s.','Optionally add some text about your store privacy policy to show during checkout.'=>'Je kunt eventueel ook tekst toevoegen over het privacybeleid van je winkel die je tijdens het afrekenen kunt laten weergeven.','Checkout privacy policy'=>'Privacybeleid afrekenen','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Je persoonsgegevens worden gebruikt om je ervaring op deze site te ondersteunen, om toegang tot je account te beheren en voor andere doeleinden zoals omschreven in ons %s.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Je kunt eventueel ook tekst toevoegen over het privacybeleid van je winkel die je op registratieformulieren van accounts kunt laten weergeven.','Registration privacy policy'=>'Privacybeleid registratie','privacy page'=>'privacypagina','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'In deze sectie kun je de weergave van het privacybeleid op je site regelen. De privacyverklaringen worden niet getoond tenzij een %s is ingesteld.','Privacy policy'=>'Privacybeleid','Removed personal data from %s order.'=>'Verwijderd persoonsgegevens van %s bestelling.' . "\0" . 'Verwijderd persoonsgegevens van %s bestellingen.','Account erasure requests'=>'Aanvragen voor het wissen van accounts','Accounts &amp; Privacy'=>'Accounts en privacy','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Lijst met toegestane factuure-mails waarmee vergeleken moet worden bij het plaatsen van een bestelling. E-mailadressen scheiden met komma\'s. Je kunt ook een asterisk (*) gebruiken om delen van een e-mailadres overeen te laten komen. Met \'*@gmail.com\' worden bijvoorbeeld alle Gmail-adressen afgestemd.','Allowed emails'=>'Toegestane e-mails','Filter by registered customer'=>'Filteren op geregistreerde klant','Remove personal data'=>'Persoonsgegevens verwijderen','Use previous column mapping preferences?'=>'Vorige voorkeuren voor kolomindeling gebruiken?','View &amp; Customize'=>'Bekijken en aanpassen','Review Settings'=>'Instellingen controleren','Visit Dashboard'=>'Naar het dashboard gaan','You can also:'=>'Je kunt ook:','You\'re ready to add products to your store.'=>'Je staat op het punt producten toe te voegen aan je winkel.','Create some products'=>'Meerdere producten toevoegen','Continue with WooCommerce Services'=>'Doorgaan met WooCommerce diensten','Connect your store to activate WooCommerce Services'=>'Koppel je winkel om WooCommerce diensten te activeren','Thanks for using Jetpack! Your store is almost ready: to activate services like %s, just connect your store.'=>'Bedankt dat je Jetpack gebruikt! Je winkel is bijna klaar: om diensten als %s te activeren, hoef je alleen je winkel te koppelen.','Mailchimp for WooCommerce'=>'Mailchimp voor WooCommerce','Mailchimp icon'=>'Mailchimp icoon','Join the 16 million customers who use Mailchimp. Sync list and store data to send automated emails, and targeted campaigns.'=>'Sluit je aan bij de 16 miljoen klanten die Mailchimp gebruiken. Synchroniseer lijsten en sla gegevens op om automatisch e-mails en gerichte campagnes te verzenden.','Mailchimp'=>'Mailchimp','automated taxes icon'=>'icoon voor automatische belastingen','Save time and errors with automated tax calculation and collection at checkout. Powered by WooCommerce Services and Jetpack.'=>'Bespaar tijd en voorkom fouten met automatische belastingberekening en -inning tijdens het afrekenen. Mogelijk gemaakt door WooCommerce-diensten en Jetpack.','Storefront icon'=>'Storefront icoon','Design your store with deep WooCommerce integration. If toggled on, we’ll install <a href="https://woocommerce.com/storefront/" target="_blank" rel="noopener noreferrer">Storefront</a>, and your current theme <em>%s</em> will be deactivated.'=>'Ontwerp je winkel met diepgaande WooCommerce integratie. Als je deze optie inschakelt, installeren we <a href="https://woocommerce.com/storefront/" target="_blank" rel="noopener noreferrer">Storefront</a>, en je huidige thema <em>%s</em> wordt gedeactiveerd.','Enhance your store with these recommended free features.'=>'Breid je winkel uit met deze aanbevolen gratis functies.','Recommended for All WooCommerce Stores'=>'Aanbevolen voor alle WooCommerce-winkels','The PayFast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs.'=>'De PayFast extensie voor WooCommerce stelt je in staat om betalingen met creditcard en EFT te accepteren via een van de populairste betaal gateways van Zuid-Afrika. Geen opstartkosten of maandelijkse abonnementskosten.','WooCommerce PayFast Gateway'=>'WooCommerce PayFast-gateway','The eWAY extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'Met de eWAY-extensie voor WooCommerce kun je creditcardbetalingen rechtstreeks vanuit je winkel aannemen, zonder dat klanten naar een site van derden omgeleid worden.','WooCommerce eWAY Gateway'=>'WooCommerce eWAY-gateway','WooCommerce Square'=>'WooCommerce Square','Klarna Payments for WooCommerce'=>'Klarna-betalingen voor WooCommerce','Klarna Checkout for WooCommerce'=>'Klarna-kassa voor WooCommerce','WooCommerce Stripe Gateway'=>'WooCommerce Stripe-gateway','The following plugins will be installed and activated for you:'=>'De volgende plugins worden voor je geïnstalleerd en geactiveerd:','Help WooCommerce improve with usage tracking'=>'Help WooCommerce te verbeteren met gebruiksgegeven